import Link from "next/link";
import axios from "axios";

export default function Index({ show }) {
  return (
    <>
      <p>Hello I am home page</p>
      <Link href="/about">
        <a>About</a>
      </Link>
      <h1>Series</h1>

      <ul>
        {show.map((show) => {
          <li key={show.id}>
            <Link href="/shows/[id]" as={`/show/${show.id}`}>
              <a>{show.name}</a>
            </Link>
          </li>;
        })}
      </ul>
    </>
  );
}

Index.getInitialProps = async () => {
